import React from 'react';
import { Input, Chip } from '@nextui-org/react';
import './styles/login'


export default function Login() {
    return (
        <div className='flex w-full flex-wrap md:flex-nowrap gap-4'>
            <Chip>Chip</Chip>
            <Input
                type='email'
                label='Email'
            />
            <Input
                type='email'
                label='Email'
                placeholder='Enter your email'
            />
        </div>
    );
}
